import React, { Component } from 'react'
import { Grid } from '@material-ui/core'


export default class Blogs extends Component {
    render() {
        return (
            <div className = "blogs">
                 <Grid container spacing={3} alignItems="center">
                    <Grid item xs={7}>
                        <div className="main-title">Careers Uncorked Blogs</div>
                        <div className="explanation"><p>Find our insight on things from getting and MBA to making the most of college during a pandemic</p>

                        </div>
                        <button className="view-livestream">View Blogs</button>
                    </Grid>
                </Grid>
            </div>


        )
    }
}
